    return(
            <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
            <div className="card text-center card-product">
                <div>
                    <h4 className="card-product__title"><a href="#">njjjj</a></h4>
                    <p className="card-product__price"><span className="cross"><del>300
                    </del></span>&nbsp;&nbsp;250</p>
                </div>
            </div>
        </div>
    );
}
export default HomePage;
